// src/pages/ProgramPage.jsx
export default function ProgramPage() {
  return (
    <div className="p-4">
      <h1 className="text-xl font-bold mb-4">프로그램 안내</h1>
      <ul className="list-disc pl-5">
        <li>09:00 - 개회 예배</li>
        <li>10:30 - 소그룹 활동</li>
        <li>12:00 - 점심 식사</li>
        <li>14:00 - 찬양 집회</li>
      </ul>
    </div>
  );
}
